import React, { useState, useEffect } from "react";
import axios from "axios";

const StockPicker = ({ history }) => {
  const [ticker, setTicker] = useState("");
  const [stockDetails, setStockDetails] = useState(null);
  const [shares, setShares] = useState("");
  const [errorMessage, setErrorMessage] = useState("");
  const [successMessage, setSuccessMessage] = useState("");
  const [autocompleteSuggestions, setAutocompleteSuggestions] = useState([]);
  const API_BASE_URL = ""

  const searchStock = async () => {
    try {
      const response = await axios.get(`${API_BASE_URL}/tickers/${ticker}`, {
        params: { access_key: process.env.REACT_APP_API_KEY },
      });
      setStockDetails(response.data);
      setErrorMessage("");
    } catch (error) {
      setStockDetails(null);
      setErrorMessage("Stock not found. Please check the ticker.");
    }
  };

  const fetchAutocompleteSuggestions = async (query) => {
    if (query.length < 1) {
      setAutocompleteSuggestions([]);
      return;
    }
    try {
      const response = await axios.get(`${API_BASE_URL}/autocomplete`, {
        params: {
          access_key: process.env.REACT_APP_API_KEY,
          query,
        },
      });
      setAutocompleteSuggestions(response.data.data || []);
    } catch (error) {
      setAutocompleteSuggestions([]);
    }
  };

  const addToPortfolio = async () => {
    try {
      const token = localStorage.getItem("token");
      const response = await axios.post(
        "http://127.0.0.1:5000/api/portfolio/add",
        { ticker, shares: parseInt(shares, 10) },
        {
          headers: { Authorization: `Bearer ${token}` },
        }
      );
      setSuccessMessage(response.data.message);
      setErrorMessage("");
      setShares(""); // Clear shares input
    } catch (error) {
      setSuccessMessage("");
      setErrorMessage(error.response?.data?.message || "Error adding stock.");
    }
  };

  const handleAutocompleteClick = (suggestion) => {
    setTicker(suggestion.symbol);
    setAutocompleteSuggestions([]);
  };

  useEffect(() => {
    fetchAutocompleteSuggestions(ticker);
  }, [ticker]);

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <h2>Add a Stock to Your Portfolio</h2>
      <div style={{ marginBottom: "20px" }}>
        <input
          type="text"
          placeholder="Enter Stock Ticker (e.g., AAPL)"
          value={ticker}
          onChange={(e) => setTicker(e.target.value.toUpperCase())}
          style={{ padding: "10px", marginRight: "10px", width: "300px" }}
        />
        <button onClick={searchStock} style={{ padding: "10px 20px" }}>
          Search
        </button>
        {autocompleteSuggestions.length > 0 && (
          <ul style={{ listStyle: "none", padding: "0", marginTop: "10px", background: "#f4f4f4" }}>
            {autocompleteSuggestions.map((suggestion) => (
              <li
                key={suggestion.symbol}
                onClick={() => handleAutocompleteClick(suggestion)}
                style={{
                  padding: "10px",
                  cursor: "pointer",
                  borderBottom: "1px solid #ddd",
                }}
              >
                {suggestion.symbol} - {suggestion.name}
              </li>
            ))}
          </ul>
        )}
      </div>

      {errorMessage && <p style={{ color: "red" }}>{errorMessage}</p>}

      {stockDetails && (
        <div style={{ marginBottom: "20px" }}>
          <h4>Stock Details:</h4>
          <p><strong>Company:</strong> {stockDetails.name}</p>
          <p><strong>Current Price:</strong> ${stockDetails.last_trade_price.toFixed(2)}</p>
        </div>
      )}

      {stockDetails && (
        <div>
          <input
            type="number"
            placeholder="Enter Number of Shares"
            value={shares}
            onChange={(e) => setShares(e.target.value)}
            style={{ padding: "10px", marginRight: "10px", width: "150px" }}
          />
          <button onClick={addToPortfolio} style={{ padding: "10px 20px" }}>
            Add to Portfolio
          </button>
        </div>
      )}

      {successMessage && <p style={{ color: "green" }}>{successMessage}</p>}

      <button onClick={() => history.push("/dashboard")} style={{ padding: "10px 20px", marginTop: "20px" }}>
        Back to Dashboard
      </button>
    </div>
  );
};

export default StockPicker;
